uint64_t DISPLAY_CoupleOut::_computeHash(const __lcm_hash_ptr *p)
{
    const __lcm_hash_ptr *fp;
    for(fp = p; fp != NULL; fp = fp->parent)
        if(fp->v == DISPLAY_CoupleOut::getHash)
            return 0;
    const __lcm_hash_ptr cp = { p, (void*)DISPLAY_CoupleOut::getHash };

    uint64_t hash = 0xbc3a18d78cc6f476LL +
         HEADER::_computeHash(&cp);

    return (hash<<1) + ((hash>>63)&1);
}

